import React from "react";

// Child functional component that receives and displays a prop
function Greeting(props) {
  return <p>Hello, {props.name}!</p>;
}

// Parent component that renders the Greeting component and passes a prop
function App() {
  return (
    <div>
      <h1>React Props Example</h1>
      <Greeting name="John" />
      <Greeting name="Alice" />
    </div>
  );
}

export default App;
